import IntroText from '../models/IntroText';

export const INTRO = [
  new IntroText('1', 'Frontend Developer. Psychologist. Entrepreneur.', 'Who I am', '#ff5b3e', "/assets/images/Intro_1.jpg"),
  new IntroText('2', 'React.js. SASS. JavaScript. Node.js. Affinity Design.', 'My main skills', '#f54242', "/assets/images/Intro_2.jpg"),
  new IntroText('3', 'Transparency. Challenges. Positive Vibes.', 'What I am looking for', '#ff5b3e', "/assets/images/Intro_3.jpg")
];

const intro = () => {
  const myIntro = [
    {
      id: '1', 
      title: 'Frontend Developer. Psychologist. Entrepreneur.', 
      subtitle: 'Who I am', 
      color: '#ff5b3e', 
      img: "/assets/images/Intro_1.jpg"
    },
    {
      id: '2', 
      title: 'React.js. SASS. JavaScript. Node.js. Affinity Design.', 
      subtitle: 'My main skills', 
      color: '#ff5b3e', 
      img: "/assets/images/Intro_2.jpg"
    },
    {
      id: '3', 
      title: 'Transparency. Challenges. Positive Vibes.', 
      subtitle: 'What I am looking for', 
      color: '#ff5b3e', 
      img: "/assets/images/Intro_3.jpg"
    }
  ]
}
